const initialState = [];

export const msgsReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'SAVE_MSGS_HISTORY':
      break;
    case 'GET_MSGS_HISTORY':
      break;
    default:
      return state;
  }
};
